function getAppointments(t){$.ajax({url:ENDPOINT+"/admin/appointments",type:"GET",data:t}).done((function(t){$("#appointments-list").html(""),t.events.forEach(t=>{$("#appointments-list").append(renderAppointmentHtml(t))})})).fail((function(t){console.log("error - ",t),$.toast({icon:"danger",text:"<p class='p-3'>Appointment Registration Failed</p>",delay:"3000",position:"top-right",dismissible:!1})}))}getAppointments(),$("#appointments-filter-form").on("submit",(function(t){t.preventDefault();let n=form2js(this,".",!0,null);console.log(n),getAppointments(n)}));